import { generateCdataString, isObject, trimArray, trimObject } from "../../../common/utils.js";

//#region src/namespaces/creativecommons/generate/utils.ts
const generateItemOrFeed = (itemOrFeed) => {
	if (!isObject(itemOrFeed)) return;
	return trimObject({ "creativeCommons:license": trimArray(itemOrFeed.licenses, generateCdataString) });
};

//#endregion
export { generateItemOrFeed };